import { Paper, Typography } from '@mui/material';
import { fontSize } from '@mui/system';
import React, { useState } from 'react';

function Poster() {
    const [value, setValue] = useState("")
    const onChange = (e) => {
        setValue(e.target.value);
    }
  return (
    <div>
      <Paper 
      sx={{
        display:"flex",
        mt:5,
        mb:5,
        height:"200px"
        }}
      >
        <Typography 
        sx={{
            color:"secondary.dark",
            fontSize:"35px",
            fontWeight: "500",


        }}
        >
            Over  
        </Typography>
        <Typography 
        sx={{
            color:"primary.main",
            fontSize:"40px",
            fontWeight: "700",


        }}
        >
           1000
        </Typography>
        <Typography 
        sx={{
            color:"secondary.dark",
            fontSize:"35px",
            fontWeight: "500",


        }}
        >
           fruits and vegetables at the store to serve customers
        </Typography>
      </Paper>
    </div>
  )
}

export default Poster
